RULES_ITEM.SQL_TEXT:
begin

    if util.getvalnum(:pk,'SUPT_REOPEN_TICKET') = 0 then 
        return; 
    end if;

    /*Increase times reopened by 1*/
    util.setvalnum(:pk, 'SUPT_TIMES_REOPENED', nvl(util.getvalnum(:pk, 'SUPT_TIMES_REOPENED'), 0) + 1);

    /*Log username of who reopened it*/
    util.setvalchar(:pk, 'SUPT_REOPENED_BY', util.getcurrentuser());

    /*Log reopened date*/
    util.setvaldate(:pk, 'SUPT_REOPENED_DATE', trunc(current_date));

    /*Uncheck the box*/
    --util.setvalnum(:pk,'SUPT_REOPEN_TICKET',0);

end;

begin

for cur in (
    select
        x.xitor_id
    from
        xitor x
        join config_value_date cvd on (cvd.key_value = x.xitor_id and cvd.config_field_id = 1000063208 /*SUPT_RESOLVED_DATE*/)
        left outer join config_value_date cvd2 on (cvd2.key_value = x.xitor_id and cvd2.config_field_id = 1000063459 /*SUPT_CLOSED_DATE*/)
    where
        x.xitor_type_id = 100006822 /*Support Ticket*/
        and trunc(current_date) - cvd.value_date >= 3
        and cvd2.value_date is null
) loop

util.setvaldate(cur.xitor_id,'SUPT_CLOSED_DATE',trunc(current_date));
util.setvalchar(cur.xitor_id,'SUPT_TICKET_STATUS','Closed');
util.lockfield(cur.xitor_id,'SUPT_REOPEN_TICKET');

end loop;

end;

declare
    v_ticket_key varchar2(4000) := util.getvalstr(:xitor_id, 'SPTE_SUBJECT');
    v_ticket_id number;
    v_subscriber_key varchar2(4000);
    v_subscriber_id number;
    v_attachment_id varchar(4000);
    v_attachment_key varchar(4000);    
    v_temp number;
    v_requester varchar2(4000);
    v_prev_ticket_id varchar(4000);
    v_EMAIL_LIST varchar2(4000);
    v_EMAIL_CUR varchar2(4000);
    v_SENDER_EMAIL varchar2(4000);
    v_SENDER_UN varchar2(4000);
    v_LOOP number := 1;
    v_COUNT number;
    v_COMMENT varchar2(10000);
    v_FLAG number := 0;
    v_SUPPORT_EMAIL varchar2(4000);
begin

    if v_ticket_key is null then
        util.raiseerror('Please provide SUPT:Subject!');
    end if;

    select email into v_SUPPORT_EMAIL from users where un = 'support_ticket_user';

    v_ticket_key := v_ticket_key || ' ';

    v_SENDER_EMAIL := util.getvalstr(:xitor_id,'SPTE_FROM');
    if instr(v_SENDER_EMAIL,'<') = 0 then
        v_SENDER_EMAIL := '<' || v_SENDER_EMAIL || '>';
    end if;

    begin
    select un into v_SENDER_UN
    from users where instr(lower(v_SENDER_EMAIL),lower(email)) > 0;
    exception when no_data_found then
        v_SENDER_UN := null;
    end;

    for cur in (
        select x.xitor_id, 
               x.xitor_key
          from xitor x
         where xitor_type_id = 100006822 /*Support Ticket*/
           and instr(v_ticket_key, x.xitor_key || ' ') > 0
    ) loop
        if util.getvalstr(cur.xitor_id, 'SUPT_TICKET_STATUS') = 'Closed' then
            v_prev_ticket_id := cur.xitor_key;
            continue;
        else
            v_ticket_id := cur.xitor_id;
        end if;
    end loop;

    v_EMAIL_LIST := lower(v_SENDER_EMAIL || ' ' || util.getvalstr(:xitor_id, 'SPTE_CC') || ' ' || util.getvalstr(:xitor_id, 'SPTE_TO'));
    v_COMMENT := util.getvalstr(:xitor_id, 'SPTE_BODY_MEMO');
    if instr(v_COMMENT, 'From:') > 0 then
        v_COMMENT := substr(v_COMMENT, 1, instr(v_COMMENT, 'From:')-1);
    end if;

    if instr(upper(v_COMMENT), 'ON ' || to_char(current_date,'DY')) > 0 then
        v_COMMENT := substr(v_COMMENT, 1, instr(upper(v_COMMENT), 'ON ' || to_char(current_date,'DY'))-1);
    end if;

    if v_ticket_id is not null then
        util.newrelation(v_ticket_id, :xitor_id);

        for cur_att in (
	        select config_field_id cfid
	        from config_field
	        where config_field_name in ('SPTE_ATTACHMENT_1','SPTE_ATTACHMENT_2','SPTE_ATTACHMENT_3','SPTE_INLINE_ATTACHMENT_1','SPTE_INLINE_ATTACHMENT_2','SPTE_INLINE_ATTACHMENT_3')
        ) loop

        if util.getvalnumbyid(:xitor_id,cur_att.cfid) is not null then
            v_attachment_id := pkg_xitor.new_xitor(100006813 /*Support Attachment*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
        	v_attachment_key := pkg_xitor.generate_xitor_key(v_attachment_id);

        	util.newrelation(v_ticket_id, v_attachment_id);

        	v_temp := util.COPYEFILE(:xitor_id, cur_att.cfid /*Current Attachment CFID*/, v_attachment_id, 1000063440 /*SPTA_ATTACHMENT_FILE*/);
        	util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_NAME', util.getvalstrbyid(:xitor_id, cur_att.cfid /*Current Attachment CFID*/));
        	util.setvaldate(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_DATE', trunc(current_date));
        	util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY', v_SENDER_EMAIL);
        	util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY_UN', v_SENDER_UN);
        	v_temp := pkg_ruleator.execute_trigger(80, 100006813 /*Support_Attachment*/, v_attachment_id);

        	v_FLAG := 1;
        end if;

        end loop;

        if v_FLAG = 1 then
            v_COMMENT := '[Attachment(s) included] ' || chr(10) || v_COMMENT;
        end if;

        util.setvalchar(v_ticket_id,'SUPT_MOST_RECENT_COMMENT_BY',v_SENDER_EMAIL);
        util.setvalchar(v_ticket_id, 'SUPT_COMMENTS', v_COMMENT);

        while instr(v_EMAIL_LIST, '<', 1, v_LOOP) > 0
        loop
            v_EMAIL_CUR := substr(v_EMAIL_LIST, instr(v_EMAIL_LIST, '<', 1, v_LOOP)+1, instr(v_EMAIL_LIST, '>', 1, v_LOOP)-1-instr(v_EMAIL_LIST, '<', 1, v_LOOP));

            select count(xitor_id)
              into v_COUNT
              from xitor x
              join config_value_char cvc on (cvc.key_value = x.xitor_id and cvc.config_field_id = 1000064324 /*SPTS_EMAIL*/)
             where x.xitor_type_id = 100006903 /*Support Subscriber*/ 
               and cvc.value_char = v_EMAIL_CUR
               and util.getparentid(x.xitor_id, 'Support_Ticket') = v_ticket_id;

            if v_COUNT = 0 and v_EMAIL_CUR <> v_SUPPORT_EMAIL and v_EMAIL_CUR <> 'support@onevizion.com' then
                v_subscriber_id := pkg_xitor.new_xitor(100006903 /*Support Subscriber*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
                v_subscriber_key := pkg_xitor.generate_xitor_key(v_subscriber_id);
                util.setvalchar(v_subscriber_id, 'SPTS_EMAIL', v_EMAIL_CUR);                
                util.newrelation(v_ticket_id, v_subscriber_id);    
            end if;

            v_LOOP := v_LOOP + 1;
        end loop;

	    if util.getvalstr(v_ticket_id, 'SUPT_TICKET_STATUS') = 'Resolved' then
			util.setvalnum(v_ticket_id, 'SUPT_REOPEN_TICKET', 1);
		end if;        

        return;
    end if;

    v_ticket_id := pkg_xitor.new_xitor(100006822 /*Support Ticket*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
    v_ticket_key := pkg_xitor.generate_xitor_key(v_ticket_id);

    util.setvalchar(v_ticket_id, 'XITOR_CLASS_ID', 'Assign a Type');
    util.newrelation(v_ticket_id, :xitor_id);

    --util.setvalchar(v_ticket_id, 'SUPT_CREATION_DATETIME_ET', util.getvalstr(:xitor_id, 'SPTE_RECEIVED_DATE_AND_TIME'));
    util.setvaldate(v_ticket_id, 'SUPT_CREATION_DATETIME_ET_NEW', to_date(util.getvalstr(:xitor_id, 'SPTE_RECEIVED_DATE_AND_TIME'), 'MM/DD/YY, HH:MI PM'));

    util.setvaldate(v_ticket_id, 'SUPT_CREATION_DATE', util.getvaldate(:xitor_id, 'SPTE_RECEIVED_DATE'));
    util.setvalchar(v_ticket_id, 'SUPT_REQUESTER_EMAIL', v_SENDER_EMAIL);
    util.setvalchar(v_ticket_id, 'SUPT_TITLE', util.getvalstr(:xitor_id, 'SPTE_SUBJECT'));
    util.setvalchar(v_ticket_id, 'SUPT_DETAILS', util.getvalstr(:xitor_id, 'SPTE_BODY_MEMO'));

    for cur_att in (
        select config_field_id cfid
        from config_field
        where config_field_name in ('SPTE_ATTACHMENT_1','SPTE_ATTACHMENT_2','SPTE_ATTACHMENT_3','SPTE_INLINE_ATTACHMENT_1','SPTE_INLINE_ATTACHMENT_2','SPTE_INLINE_ATTACHMENT_3')
    ) loop

    if util.getvalnumbyid(:xitor_id,cur_att.cfid) is not null then
        v_attachment_id := pkg_xitor.new_xitor(100006813 /*Support Attachment*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
        v_attachment_key := pkg_xitor.generate_xitor_key(v_attachment_id);

        util.newrelation(v_ticket_id, v_attachment_id);

        v_temp := util.COPYEFILE(:xitor_id, cur_att.cfid /*Current Attachment CFID*/, v_attachment_id, 1000063440 /*SPTA_ATTACHMENT_FILE*/);
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_NAME', util.getvalstrbyid(:xitor_id, cur_att.cfid /*Current Attachment CFID*/));
        util.setvaldate(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_DATE', trunc(current_date));
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY', v_SENDER_EMAIL);
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY_UN', v_SENDER_UN);
        v_temp := pkg_ruleator.execute_trigger(80, 100006813 /*Support_Attachment*/, v_attachment_id);
    end if;

    end loop;

    if util.getvalnum(v_ticket_id, 'SUPT_PRECEDING_TICKET') is null then
        util.setvalchar(v_ticket_id, 'SUPT_PRECEDING_TICKET', v_prev_ticket_id);
    end if;
    util.lockfield(v_ticket_id, 'SUPT_PRECEDING_TICKET');

    v_requester := lower(util.getvalstr(v_ticket_id, 'SUPT_REQUESTER_EMAIL'));

    for cur in (
        select x.xitor_id
          from xitor x
          join users u on (u.xitor_id = x.xitor_id and instr(v_requester, lower(u.email)) > 0)
         where x.xitor_type_id = 100006781 /*Users*/
    ) loop
        util.setvalnum(v_ticket_id, 'SUPT_TICKER_REQUESTER', cur.xitor_id, 1);
    end loop;

    while instr(v_EMAIL_LIST, '<', 1, v_LOOP) > 0
    loop
        v_EMAIL_CUR := substr(v_EMAIL_LIST, instr(v_EMAIL_LIST, '<', 1, v_LOOP)+1, instr(v_EMAIL_LIST, '>', 1, v_LOOP)-1-instr(v_EMAIL_LIST, '<', 1, v_LOOP));

        select count(xitor_id)
          into v_COUNT
          from xitor x
          join config_value_char cvc on (cvc.key_value = x.xitor_id and cvc.config_field_id = 1000064324 /*SPTS_EMAIL*/)
          where x.xitor_type_id = 100006903 /*Support Subscriber*/ 
            and cvc.value_char = v_EMAIL_CUR 
            and util.getparentid(x.xitor_id, 'Support_Ticket') = v_ticket_id;

        if v_COUNT = 0 and v_EMAIL_CUR <> v_SUPPORT_EMAIL and v_EMAIL_CUR <> 'support@onevizion.com' then
            v_subscriber_id := pkg_xitor.new_xitor(100006903 /*Support Subscriber*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
            v_subscriber_key := pkg_xitor.generate_xitor_key(v_subscriber_id);
            util.setvalchar(v_subscriber_id, 'SPTS_EMAIL', v_EMAIL_CUR);            
            util.newrelation(v_ticket_id, v_subscriber_id);    
        end if;

        v_LOOP := v_LOOP + 1;
    end loop;
    v_temp := pkg_ruleator.execute_trigger(18, 100006822 /*Support Ticket*/, v_ticket_id);

end;

declare
    v_DATE date;
    v_NAME varchar2(1000);
    v_USER varchar2(1000);
    v_EMAIL varchar2(1000);
    v_COMMENTS_HISTORY clob;
    v_COMMENTS clob;
    v_TEMP clob;

    c_SUPT_COMMENTS_cfid constant number := 1000063278 /*SUPT_COMMENTS*/;
    c_SUPT_RES_NOTES_cfid constant number := 1000063177 /*SUPT_RESOLUTION_NOTES*/;
    c_SUPT_COMMENTS_LOG_cfid constant number := 1000063292 /*SUPT_COMMENTS_LOG*/;
    c_SUPT_COMMENTS_LAST_UPDT_cfid constant number := 1000063257 /*SUPT_COMMENTS_LAST_UPDATED*/;

begin

    if util.getvalmemobyid(:pk,c_SUPT_COMMENTS_cfid) is null and :id_num = c_SUPT_COMMENTS_cfid then
        return;
    end if;

    v_USER := util.getcurrentuser();

    v_NAME := util.getvalstrbyid(util.getcurrentusertrackorid(),100163668) /*US_FULL_NAME*/;
    v_DATE := trunc(current_date);

    select lower(email) into v_EMAIL
    from users where un = v_USER;

    if v_USER = 'support_ticket_user' then
        v_USER := util.getvalstr(:pk,'SUPT_MOST_RECENT_COMMENT_BY');
    else v_USER := v_NAME || ' <' || v_EMAIL || '>';
    end if;

    if :id_num = 1000063131 /*SUPT:Ticket Resolved*/ and util.getvalnumbyid(:pk,:id_num) = 1 then 
        if util.getvalmemobyid(:pk,c_SUPT_RES_NOTES_cfid) is null then 
            util.raiseerror('Please uncheck the Ticket Resolved box, fill in Resolution Notes, and press Apply. You can then check the Ticket Resolved box after Resolution Notes have been submitted.');
        else 
            v_COMMENTS := '(Resolution Notes) ' || util.getvalmemobyid(:pk,c_SUPT_RES_NOTES_cfid);
        end if;
    elsif :id_num = 1000063278 /*SUPT:Comments*/ then 
        v_COMMENTS := util.getvalmemobyid(:pk,c_SUPT_COMMENTS_cfid);
    else 
        return;
    end if;

    v_COMMENTS_HISTORY := util.getvalmemobyid(:pk,c_SUPT_COMMENTS_LOG_cfid);

    v_TEMP := v_USER || ' ' || to_char(current_date,'MM/DD/YYYY HH24:MI') || ' ET:' || chr(10) || v_COMMENTS || chr(10) || chr(10) || '------Next Comment------' || chr(10) ||v_COMMENTS_HISTORY;

    util.setvalmemobyid(:pk,c_SUPT_COMMENTS_LOG_cfid,v_TEMP);
    util.setvaldatebyid(:pk,c_SUPT_COMMENTS_LAST_UPDT_cfid,v_DATE);
    util.setvalmemobyid(:pk,c_SUPT_COMMENTS_cfid,null);

end;

declare
    v_SUPT_REQUESTER_EMAIL varchar2(4000) := util.getvalstr(:pk,'SUPT_REQUESTER_EMAIL');
    v_USER_ID number := util.getvalnumbyid(:pk,:id_num);
    v_EMAIL varchar2(4000);
    v_COUNT number;
    v_subscriber_id number;
    v_subscriber_key varchar2(4000);

begin

    select lower(EMAIL)
    into v_EMAIL
    from users
    where users.xitor_id = v_USER_ID;

    v_SUPT_REQUESTER_EMAIL := util.getvalstr(v_USER_ID,'US_FULL_NAME') || ' <' || v_EMAIL || '>';

    util.setvalchar(:pk,'SUPT_REQUESTER_EMAIL',v_SUPT_REQUESTER_EMAIL);

    select count(xitor_id)
    into v_COUNT
    from xitor x
    join config_value_char cvc on (cvc.key_value = x.xitor_id and cvc.config_field_id = 1000064324 /*SPTS_EMAIL*/)
    where
    x.xitor_type_id = 100006903 /*Support Subscriber*/ and
    cvc.value_char = v_EMAIL and
    util.getparentid(x.xitor_id,'Support_Ticket') = :pk;

    if v_COUNT = 0 then
        v_subscriber_id := pkg_xitor.new_xitor(100006903 /*Support Subscriber*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
        v_subscriber_key := pkg_xitor.generate_xitor_key(v_subscriber_id);
        util.setvalchar(v_subscriber_id,'SPTS_EMAIL',v_EMAIL);        
        util.newrelation(:pk,v_subscriber_id);    
    end if;

end;

declare
    v_EMAIL_CUR varchar2(4000);
    v_ID number := 0;
    v_subscriber_id number;
    v_subscriber_key varchar2(4000);

begin

if
    nvl(util.getvalnum(:pk,'SUPT_SUBSCRIBE_TO_TICKET'),0) = 0 and
    nvl(util.getvalnum(:pk,'SUPT_UNSUBSCRIBE_FROM_TICKET'),0) = 0
then
    return;
end if;

select lower(email)
into v_EMAIL_CUR
from users
where user_id = pkg_sec.get_cu();

begin

select x.xitor_id
into v_ID
from xitor x
join config_value_char cvc on (cvc.key_value = x.xitor_id and cvc.config_field_id = 1000064324 /*SPTS_EMAIL*/)
join users u on (lower(u.email) = cvc.value_char and u.user_id = pkg_sec.get_cu())
where
x.xitor_type_id = 100006903 /*Support Subscriber*/ and
util.getparentid(x.xitor_id,'Support_Ticket') = :pk;

exception when no_data_found then
    v_ID := 0;
end;

if :id_num = 1000064341 /*Subscribe*/ and v_ID = 0 then
    v_subscriber_id := pkg_xitor.new_xitor(100006903 /*Support Subscriber*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
    v_subscriber_key := pkg_xitor.generate_xitor_key(v_subscriber_id);
    util.setvalchar(v_subscriber_id,'SPTS_EMAIL',v_EMAIL_CUR);    
    util.newrelation(:pk,v_subscriber_id);    
end if;



if :id_num = 1000064342 /*Unsubscribe*/ and v_ID > 0 then

    pkg_xitor.drop_xitor(v_ID);

end if;

util.setvalnumbyid(:pk,:id_num,0);

end;

declare
    v_body clob;
    v_sender varchar2(4000);
    v_platform_name varchar2(4000);    
begin

select lower(email)
into v_sender
from users
where un = 'support_ticket_user';

v_platform_name := RPT.getvalstr(:xitor_id,'SUPT_PLATFORM_NAME');

v_body := 'Your Support Ticket request has been received.  Your Support Ticket ID is <b>' || util.getvalstr(:xitor_id, 'XITOR_KEY') || '.</b>
</br></br>
A technician will be with you shortly. Please reply back to this email if there are additional details or attachments to share.
</br></br>
Sent from ' || v_platform_name ||'. Powered by OneVizion.
';

for cur in (
    select
        supt_spts.child_id SPTS_ID
      , lower(UTIL.getvalstr(supt_spts.child_id,'SPTS_EMAIL')) SPTS_EMAIL
    from
        relation supt_spts
        left outer join users u on (lower(u.email) = lower(rpt.getvalstr(supt_spts.child_id,'SPTS_EMAIL')))
    where
        supt_spts.relation_type_id = 100006823 /*SUPT -> SPTS*/
        and supt_spts.parent_id = :xitor_id
        and
            (RPT.getvalstr(supt_spts.child_id,'SPTS_RELATED_USER') is null /*No user ID available*/ or u.is_disabled = 1)
) loop

util.sendmail(
    Subject => 'New Support Ticket - ' || util.getvalstr(:xitor_id, 'XITOR_KEY') || ' (' || util.getvalstr(:xitor_id, 'SUPT_TITLE') || ')',
    Message => v_body,
    Sender => v_sender,
    Recipient => cur.SPTS_EMAIL,
    STYLE =>'html'
    );

end loop;

end;

