    v_body clob;
    v_TICKET_KEY varchar2(4000);
    v_RESOLUTION_NOTES varchar2(4000);
    v_RESOLVING_TECH varchar2(4000);
    v_TITLE varchar2(4000);
    v_platform_name varchar2(4000);
