    select
        supt_spts.child_id SPTS_ID
      , lower(UTIL.getvalstr(supt_spts.child_id,'SPTS_EMAIL')) SPTS_EMAIL
    from
        relation supt_spts
        left outer join users u on (lower(u.email) = lower(rpt.getvalstr(supt_spts.child_id,'SPTS_EMAIL')))
    where
        supt_spts.relation_type_id = 100006823 /*SUPT -> SPTS*/
        and supt_spts.parent_id = :pk
        and
