declare 
    v_attachment_id varchar(4000);
    v_attachment_key varchar(4000);
    v_ticket_id varchar(4000);
    v_first varchar(4000);
    v_last varchar(4000);
    v_email varchar(4000);
    v_temp number;

    c_attachment_1_cfid constant number := 1000062946 /*SUPT_ATTACHMENT_1*/;
    c_attachment_2_cfid constant number := 1000062959 /*SUPT_ATTACHMENT_2*/;
    c_attachment_3_cfid constant number := 1000063245 /*SUPT_ATTACHMENT_3*/;
    v_user number;
    v_result_string varchar(4000);
    v_user_id number;
begin

    v_user_id := util.getcurrentuserid();

    select x.xitor_id, lower(u.email)
    into v_user, v_email
    from xitor x
    join users u on (u.xitor_id = x.xitor_id and u.user_id = v_user_id)
    where x.xitor_type_id = 100006781;

    v_first := util.getvalstr(v_user, 'US_FIRST_NAME');
    v_last := util.getvalstr(v_user, 'US_LAST_NAME');

    v_result_string := v_first || ' ' || v_last || ' <' || v_email || '>';

    /*Attachment 1*/
    if util.getvalnumbyid(:xitor_id,c_attachment_1_cfid) is not null then
        v_attachment_id := pkg_xitor.new_xitor(100006813 /*Support Attachment*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
        v_attachment_key := pkg_xitor.generate_xitor_key(v_attachment_id);

        util.newrelation(:xitor_id, v_attachment_id);

        v_temp := util.COPYEFILE(:xitor_id, c_attachment_1_cfid, v_attachment_id, 1000063440 /*SPTA_ATTACHMENT_FILE*/);
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_NAME', util.getvalstrbyid(:xitor_id, c_attachment_1_cfid));
        util.setvaldate(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_DATE', trunc(current_date));
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY_UN', util.getcurrentuser());  
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY', v_result_string, 1);

        util.deleteefile(:xitor_id, c_attachment_1_cfid);
        v_temp := pkg_ruleator.execute_trigger(80, 100006813 /*Support_Attachment*/, v_attachment_id);
    end if;

    /*Attachment 2*/
    if util.getvalnumbyid(:xitor_id,c_attachment_2_cfid) is not null then
        v_attachment_id := pkg_xitor.new_xitor(100006813 /*Support Attachment*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
        v_attachment_key := pkg_xitor.generate_xitor_key(v_attachment_id);

        util.newrelation(:xitor_id, v_attachment_id);

        v_temp := util.COPYEFILE(:xitor_id, c_attachment_2_cfid, v_attachment_id, 1000063440 /*SPTA_ATTACHMENT_FILE*/);
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_NAME', util.getvalstrbyid(:xitor_id, c_attachment_2_cfid));
        util.setvaldate(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_DATE', trunc(current_date));
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY_UN', util.getcurrentuser());        
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY', v_result_string, 1);

        util.deleteefile(:xitor_id, c_attachment_2_cfid);
        v_temp := pkg_ruleator.execute_trigger(80, 100006813 /*Support_Attachment*/, v_attachment_id);
    end if; 

    /*Attachment 3*/
    if util.getvalnumbyid(:xitor_id,c_attachment_3_cfid) is not null then
        v_attachment_id := pkg_xitor.new_xitor(100006813 /*Support Attachment*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
        v_attachment_key := pkg_xitor.generate_xitor_key(v_attachment_id);

        util.newrelation(:xitor_id, v_attachment_id);

        v_temp := util.COPYEFILE(:xitor_id, c_attachment_3_cfid, v_attachment_id, 1000063440 /*SPTA_ATTACHMENT_FILE*/);
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_NAME', util.getvalstrbyid(:xitor_id, c_attachment_3_cfid));
        util.setvaldate(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_DATE', trunc(current_date));
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY_UN', util.getcurrentuser());        
        util.setvalchar(v_attachment_id, 'SPTA_ATTACHMENT_CREATED_BY', v_result_string, 1);

        util.deleteefile(:xitor_id, c_attachment_3_cfid);
        v_temp := pkg_ruleator.execute_trigger(80, 100006813 /*Support_Attachment*/, v_attachment_id);
    end if;   

end;

declare

v_subscriber varchar2(4000);

begin

    v_subscriber := util.getvalstrbyid(:pk, :id_num);

    for cur in (
        select x.xitor_id
          from xitor x
          join users u on (u.xitor_id = x.xitor_id and instr(lower(v_subscriber), lower(u.email)) > 0)
         where x.xitor_type_id = 100006781 /*Users*/
    ) loop
        util.setvalnum(:pk, 'SPTS_RELATED_USER', cur.xitor_id, 1);
    end loop;

end;

declare
    v_INPUT varchar2(4000);
    v_UN_CURRENT varchar2(4000);
    v_LOOP number := 1;

    v_subscriber_id number;
    v_subscriber_key varchar2(4000);

    v_COUNT number := 0;

begin

    v_INPUT := util.getvalstrbyid(:pk,:id_num);

    if v_INPUT is null then
        return;
    end if;

    for cur in (
        select
            un, lower(email) em
        from
            users
    ) loop

    if instr(v_INPUT,cur.un) > 0 then

          select count(xitor_id)
          into v_COUNT
          from xitor x
          where x.xitor_type_id = 100006903 /*Support Subscriber*/ 
          and util.getparentid(x.xitor_id, 'Support_Ticket') = :pk
          and util.getvalstr(x.xitor_id,'SPTS_RELATED_USER') = cur.un;

        if v_COUNT = 0 then
            v_subscriber_id := pkg_xitor.new_xitor(100006903 /*Support Subscriber*/, null, null, null, pkg_sec.get_cu(), pkg_sec.get_pid(), null);
            v_subscriber_key := pkg_xitor.generate_xitor_key(v_subscriber_id);
            util.setvalchar(v_subscriber_id, 'SPTS_EMAIL', cur.em);            
            util.newrelation(:pk, v_subscriber_id);    
        end if;

    end if;

    end loop;

    util.setvalcharbyid(:pk,:id_num,null);

end;

declare
v_TODAY date;
v_CREATED date;
begin

    if to_char(current_date, 'HH24') not in ('03') then
        return;
    end if;

v_TODAY := trunc(current_date);

for cur in (
    select
        x.xitor_id
    from
        xitor x
    where
        x.xitor_type_id = 100006822 /*Support Ticket*/
) loop

v_CREATED := util.getvaldate(cur.xitor_id,'SUPT_CREATION_DATE');

util.setvalnum(cur.xitor_id,'SUPT_TICKET_AGE', v_TODAY - v_CREATED);

end loop;

end;

declare
    v_ovs_id number;
    v_ovs_name varchar2(2000);    
begin

    select ovs.xitor_id
      into v_ovs_id
      from xitor ovs
     where ovs.xitor_type_id = 100006839 /*OVS*/
       and rownum = 1;

    v_ovs_name := util.getvalstr(v_ovs_id, 'OVS_CUSTOMER_SYSTEM_NAME');
    util.setvalchar(:xitor_id, 'SUPT_PLATFORM_NAME', v_ovs_name);

end;
